import React from "react";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Outlet,
    NavLink,
    useParams,
    useSearchParams,
    Navigate,
    useNavigate,
    Link,
  } from 'react-router-dom';
import "./App.css";
const setActive = ({ isActive }) => (isActive ? 'active' : '');
function NavMenu() {
    return (
      <div className="navMenu">
        <NavLink to="/" className={setActive}>
          Home
        </NavLink>
        <NavLink to="/famous_landmark" className={setActive}>
            famous landmark
        </NavLink>
        <NavLink to="photos_of_the_city" className={setActive}>
            photos of the city
        </NavLink>

      </div>
    );
  }
  function Home() {
      return (
          <div className="home">
              <h1>Чернівці́</h1>
              <p><b>Чернівці́</b>&nbsp;— <a href="/wiki/%D0%90%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D0%B9_%D1%86%D0%B5%D0%BD%D1%82%D1%80" title="Адміністративний центр">адміністративний</a>, <a href="/wiki/%D0%9F%D0%BE%D0%BB%D1%96%D1%82%D0%B8%D0%BA%D0%B0" title="Політика">політичний</a> і <a href="/wiki/%D0%A0%D0%B5%D0%BB%D1%96%D0%B3%D1%96%D1%8F" title="Релігія">релігійний</a> центр <a href="/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C" title="Чернівецька область">Чернівецької області</a>, важливий <a href="/wiki/%D0%9A%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%B0" title="Культура">культурний</a> та <a href="/wiki/%D0%9D%D0%B0%D1%83%D0%BA%D0%B0" title="Наука">науково</a>-<a href="/wiki/%D0%92%D0%B8%D1%89%D0%B0_%D0%BE%D1%81%D0%B2%D1%96%D1%82%D0%B0" title="Вища освіта">освітній</a> осередок України. Місто розміщене на південному заході <a href="/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0" title="Україна">України</a> за 40&nbsp;км від <a href="/wiki/%D0%A0%D1%83%D0%BC%D1%83%D0%BD%D1%96%D1%8F" title="Румунія">румунського</a> кордону. Чисельність населення міста становить 264,3 тис. осіб (01.01.2022). Територія Чернівців становить 153 км². Місто&nbsp;— центр <a href="/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B0_%D0%B0%D0%B3%D0%BB%D0%BE%D0%BC%D0%B5%D1%80%D0%B0%D1%86%D1%96%D1%8F" title="Чернівецька агломерація">Чернівецької агломерації</a>, населення якої складає 723,1 тис. осіб.
</p>
          </div>
      );
  }
    function FamousLandmark() {
        return (
            <div className="famousLandmark">
                <h1>famous landmark</h1>
            </div>
        );
    }
    function PhotosOfTheCity() {
        return (
            <div className="photosOfTheCity">
                <h1>photos of the city</h1>
            </div>
        );
    }

  export default function MyCity() {
    return (
        <div className = "App">
            <Router>
                <NavMenu />
                <Routes>
                    <Route path="/" exact element={<Home/>} />
                    <Route path="/famous_landmark" element={<FamousLandmark/>} />
                    <Route path="/photos_of_the_city" element={<PhotosOfTheCity/>} />
                </Routes>
            </Router>
        </div>         
    );
} 


